      .crystalDiamond-count-txt {
        margin-top: 1%;
        margin-left: 12%;
        font-weight: 800;

      }
      .light {
        position: absolute;
        height: 10px;
        width: 10px;
        border-radius: 50%;
        top: 5px;
        left: 115px;
        transform-origin: 5px 115px;
      }
      .light-twinkling {
        animation: 1s twinkling 3, 100ms 3s twinkling 3;
      }
      .light:nth-child(2n) {
      }
      .light:nth-child(2n + 1) {
      }
      .light:nth-child(2) {
        transform: rotate(36deg);
      }
      .light:nth-child(3) {
        transform: rotate(72deg);
      }
      .light:nth-child(4) {
        transform: rotate(108deg);
      }
      .light:nth-child(5) {
        transform: rotate(144deg);
      }
      .light:nth-child(6) {
        transform: rotate(180deg);
      }
      .light:nth-child(7) {
        transform: rotate(216deg);
      }
      .light:nth-child(8) {
        transform: rotate(252deg);
      }
      .light:nth-child(9) {
        transform: rotate(288deg);
      }
      .light:nth-child(10) {
        transform: rotate(324deg);
      }
      .crystalDiamond-panel {
        margin: 24px auto 0;
        position: relative;
        height: 200px;
        width: 200px;
        border-radius: 100px;
        overflow: hidden;
      }
      .crystalDiamond-sector {
        position: absolute;
        left: 100px;
        top: 0px;
        width: 100px;
        height: 200px;
        font-size: 14px;
        border-radius: 0px 100px 100px 0;
        overflow: hidden;
        transform-origin: left center;
      }
      .crystalDiamond-sector:nth-child(1) {
        transform: rotate(-72deg);
      }
      .crystalDiamond-sector:nth-child(2) {
        transform: rotate(0deg);
      }
      .crystalDiamond-sector:nth-child(3) {
        transform: rotate(72deg);
      }
      .crystalDiamond-sector:nth-child(4) {
        transform: rotate(144deg);
      }
      .crystalDiamond-sector:nth-child(5) {
        transform: rotate(216deg);
      }

      }

     function crystalDiamondcrystalDiamondgoPageNo(type) {
      let dialog = document.getElementById("crystalDiamond-dialog-box");
      if (type) {
        dialog.style.display = "none";
      } else {
        dialog.style.display = "flex";
      }
    }
    function crystalDiamondsayHello() {
      home.style.display = "none";
      listpage.style.display = "flex";
      back.style.display = "block";
      pageType = "list";
    }
    var getEle,
      pointer,
      result,
      play,
      countValue,
      txt,
      home,
      wrapper,
      back,
      value,
      listpage,
      pageType;
    function crystalDiamondinit() {
      getEle = document.getElementsByClassName.bind(document);
      pointer = document.getElementById("pointer");
      result = document.getElementById("result");
      play = document.getElementById("play");
      countValue = document.getElementById("count-txt");
      txt = document.getElementById("txt");
      home = document.getElementById("crystalDiamond-button-home");
      listpage = document.getElementById("crystalDiamond-button-list");

      wrapper = document.getElementById("wrapper");
      back = document.getElementById("back");
      value = 1000;
      countValue.innerHTML = value;
      pointer.addEventListener("transitionend", () => {
        setTimeout(() => {
          onRotation = false;
          result.style.display = "block";
          countValue.innerHTML = value;
        }, 300);
      });
    }
    var onRotation = false;
    var reward = ["5000", "10000", "8000", "8000", "10000"];
    var crystalDiamondgetReward = (function () {
      currentDeg = 0;
      return function () {
        var rotateDeg = Math.random() * 360 + 1080;
        currentDeg += rotateDeg;
        var rewardText = reward[Math.floor((currentDeg % 360) / 72)];
        return { deg: currentDeg, text: rewardText };
      };
    })();
    function crystalDiamondresults() {
      result.style.display = "none";
    }
    function crystalDiamondbacks() {
      if (pageType == "list") {
        listpage.style.display = "none";
        back.style.display = "none";
        home.style.display = "flex";
      } else {
        wrapper.style.display = "none";
        crystalDiamondsayHello();
      }
    }
    function crystalDiamondgoPage() {
      pageType = "page";
      //   back.style.display = "none";
      listpage.style.display = "none";
      wrapper.style.display = "block";
    }
    function crystalDiamondplays() {
      if (onRotation) return;
      onRotation = true;
      value = value - 60;
      countValue.innerHTML = value;
      var nextStatus = crystalDiamondgetReward();
      txt.innerHTML = nextStatus.text;
      value += parseInt(nextStatus.text);
      result.style.display = "none";
      pointer.style.transform = ` translate(-50%, -59%) rotateZ(${nextStatus.deg}deg)`;
    }
